import styled from "styled-components";
import { FiUser } from "react-icons/fi";
import { withProps } from "../util";
import dumpStyles from "./style_templates";
import Theme from "../theme";

const styles = Theme.form;

const Form = (props) => {
  return withProps(Container, props);
};
const Container = styled.form`
  ${dumpStyles(styles)}
  display: flex;
  width: 100%;
  height: 100%;
  flex-direction: column;

  .Form_SubContainer {
    border: 2px solid;
    ${dumpStyles(styles.subcontainer)}
    & > * {
      ${dumpStyles(styles.subcontainer.items)}
    }
  }

  input {
    ${dumpStyles(styles.input)}
  }
`;

const Input = styled.input``;

Form.prototype.input = ({ children, ...props }) => {
  return (
    <span>
      <FiUser /> <input {...props}>{children}</input>
    </span>
  );
};

export default Form;
